    GetWeight() {
        this.msg_supress = true;
        if (this._electronService.isElectronApp) {
            console.log("electron Entry");
            this.ngZone.runOutsideAngular(() => {
                this._electronService.ipcRenderer.send('Weight-Request', 'get - Weight');
                console.log('electron -- Weight-Request');
            });
            this.ngZone.runOutsideAngular(() => {
                console.log('electron -- run');
                this._electronService.ipcRenderer.on('Weight-Reply', (event, arg) => {
                    console.log('electron -- Weight-Reply' + arg);
                    console.log(arg); // prints "Ip Address"
                    this.responseCode = arg.split('#')[0];
                    console.log(this.responseCode);
                    this.responseMsg = arg.split('#')[1];
                    this.weight = arg.split('#')[2];
                    this.ngZone.runTask(() => {
                        console.log(this.responseCode);
                        if (this.responseCode === "0") {
                            console.log("WB Not Connected ... try again");
                        }
                        else {
                            if (this.msg_supress) {
                                console.log("WB Succesfully Read");
                                let MachineWgt = parseFloat(this.weight);
                                console.log(MachineWgt);
                                if (Number.isNaN(MachineWgt) || MachineWgt == 0.000 || MachineWgt == 0) {
                                    this.showAlert("Please try Again");
                                    this.registerForm.get('newtareWeight').patchValue("");
                                }
                                else {
                                    this.registerForm.get('newtareWeight').patchValue(MachineWgt);
                                }
                                //  this.registerForm.get('newtareWeight')!.patchValue(MachineWgt)
                            }
                        }
                        this.msg_supress = false;
                    });
                });
            });
        }
    }
    edValueKeyPress() {
        var edValue = this.registerForm.value.stickerNo;
        // document.getElementById("exitstikerNo");
        console.log("KEY PRESS::" + edValue);
        if (edValue.length >= 10) {
            let data = "brid=" + this.logbrId + "&StickerNo=" + edValue;
            this.dataService.verifyotherloan(data).subscribe((res) => {
                this.verifyotherData = res;
                console.log("Verify Load Data:::" + JSON.stringify(this.verifyotherData));
                if (this.verifyotherData.status == null || this.verifyotherData.status == "111" || this.verifyotherData.status == "222" || this.verifyotherData.status == "555") {
                    this.registerForm.get('pledgeNo').patchValue(this.verifyotherData.Pledge_NO);
                    this.registerForm.get('name').patchValue(this.verifyotherData.Customer_Name);
                    this.registerForm.get('amount').patchValue(this.verifyotherData.PledgeVal);
                    this.registerForm.get('actualWeight').patchValue(this.verifyotherData.Actwt);
                    this.registerForm.get('exittareWeight').patchValue(this.verifyotherData.ExistTarewt);
                    this.tareExcption = this.verifyotherData.TrewtExcptn;
                    // this.irregularity=this.verifyotherData.Irregularity;
                    if (this.verifyotherData.status == "222" || this.verifyotherData.status == "555") {
                        this.showAlert(this.verifyotherData.result);
                    }
                }
                else {
                    this.showAlert(this.verifyotherData.result);
                }
            });
        }
        else {
            this.registerForm.get('pledgeNo').patchValue('');
            this.registerForm.get('name').patchValue('');
            this.registerForm.get('amount').patchValue('');
            this.registerForm.get('actualWeight').patchValue('');
            this.registerForm.get('exittareWeight').patchValue('');
        }
    }
