            this.registerForm.get('name').patchValue(this.updateData.name);
            this.registerForm.get('amount').patchValue(this.updateData.amount);
            this.registerForm.get('pledgeDate').patchValue(this.updateData.pledgeDate);
            this.registerForm.get('grassWeight').patchValue(this.updateData.grassWeight);
