                this.registerForm.get('pledgeNo').patchValue(this.verifyData.Pledge_NO);
                this.registerForm.get('name').patchValue(this.verifyData.Customer_Name);
                this.registerForm.get('amount').patchValue(this.verifyData.PledgeVal);
                this.registerForm.get('grassWeight').patchValue(this.verifyData.Actwt);
